import React from "react";
import "./Plans.css";
function Plans() {
  return (
    <div className="Plans" id="plans">
      <span>READY TO START </span>
      <span>YOUR JOURNEY </span>
      <span>NOW WITH US </span>
    </div>
  );
}

export default Plans;
